import React, { Component } from 'react';
import axios from 'axios';
import Card from './RestaurantCard';


export default class NewsEvent extends Component {

    constructor(props) {
        super(props);
        this.state = { users: [] };
    }

    componentDidMount() {
        axios.get('restaurants/')
            .then(response => {
                console.log(response.data)
                this.setState({ users: response.data });
            })
            .catch((error) => {
                console.log(error);
            })
    }

    restaurantList() {
        return this.state.users.map(currentCompany => {
            return <Card user={currentCompany} key={currentCompany._id} />;
        })
    }

    render() {
        return (
            <div className = "container">
                <h3>Resturant List</h3>
                <div className="row">
                        {this.restaurantList()}           
                </div>
            </div>
        );
    }
}
